import logo from "../../assets/images/google-logo.png"
import classes from "./Login.module.css"

const Login = (props) =>{
    console.log(props.signIn)

    function login() {
        props.signIn()
    }

    return (
        <div >
            <button className={classes.bigDiv} onClick={login}>
            <img src={logo} width="30px"/>
            Log In with Google
            </button>

        </div>
    )

}
export default Login
